import { Button } from "@mui/material";

import { useCallback, useState } from "react";
import { FormProvider, useForm } from "react-hook-form";
import { Bank } from "../components/Bank";
import { Address } from "../components/Address";
import { PersonalInfo } from "../components/PersonalInfo";
import { OrganizationInfo } from "../components/OrganizationInfo";
import { ContractPage } from "./ContractPage";
export interface DataProps {
  status?: string;
  iin?: string;
  fullNameOfOrganization?: string;
  secondName?: string;
  firstName?: string;
  fathersName?: string;
  email?: string;
  phone: string;
  position: string;
  responsobilities: string;
  region: null;
  area: string;
  adress: string;
  bank: string;
  bik: string;
  iik: string;
  kbe: string;
}
export const FormPage = () => {
  const methods = useForm({
    mode: "onChange",
    defaultValues: {
      status: "",
      iin: "",
      fullNameOfOrganization: "",
      secondName: "",
      firstName: "",
      fathersName: "",
      email: "",
      phone: "",
      position: "",
      responsobilities: "",
      region: null,
      area: "",
      adress: "",
      bank: "",
      bik: "",
      iik: "",
      kbe: "",
    },
  });

  const { handleSubmit, reset, getValues } = methods;
  const [contractShow, setContractShow] = useState(false);

  const onSubmit = useCallback(
    (values: DataProps) => {
      console.log(values);

      reset();
    },
    [reset],
  );
  const myData: DataProps = getValues();
  const show = () => {
    alert(JSON.stringify(getValues()));
    console.log(getValues());
    setContractShow(true);
  };

  return (
    <>
      <FormProvider {...methods}>
        <form onSubmit={handleSubmit(onSubmit)} style={{ marginLeft: "60px" }}>
          <OrganizationInfo />

          <PersonalInfo />

          <Address />
          <Bank />
          <Button type="submit" variant="contained">
            Подписать с ЭЦП
          </Button>
          <Button variant="contained" onClick={show}>
            Предпросмотр
          </Button>
        </form>
      </FormProvider>

      {contractShow && <ContractPage {...myData} />}
    </>
  );
};
